import React, { useState } from 'react';
import { Form, Button, Alert } from 'react-bootstrap';
import axios from 'axios';


const RegisterPage = () => {
  const [formData, setFormData] = useState({
    first_name: '',
    last_name: '',
    email: '',
    password: '',
    confirmPassword: '',
    phoneNumber: '',
    countryCode: '',
  });

  const [userExistsError, setUserExistsError] = useState('');
  const [passwordsMatchError, setPasswordsMatchError] = useState('');

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  // Function to check if a user with the given email exists
  const checkUserExists = async (email) => {
    try {
      const response = await axios.get(`/auth/api/check-user?email=${email}`);
      return response.data.exists;
    } catch (error) {
      console.error('Error checking user existence:', error.message);
      return false;
    }
  };


  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      // Check if the passwords match
      if (formData.password !== formData.confirmPassword) {
        // Display an error message or prevent form submission

        setPasswordsMatch(false);
        return;
      }

      setPasswordsMatch(true);

      const userExists = await checkUserExists(formData.email);

      if (userExists) {
        // Display an error message or prevent form submission
        console.error('User with this email already exists');
        setUserExists(true);
        return;
      }

      // Make an API request to your backend for user registration
      const response = await axios.post('/auth/api/register', formData);

      // Handle the response
      console.log('Registration successful:', response.data);
      // Redirect the user to a success page or perform other actions

    } catch (error) {
      // Handle registration error
      console.error('Registration error:', error.response.data);
      // Display an error message to the user or perform other error handling
    }
  };

  return (
    <div className="container mt-5">
      <h2>Register</h2>
      {!passwordsMatch && (
        <Alert variant="danger">
          Passwords do not match. Please check your input.
        </Alert>
      )}
      {userExists && (
        <Alert variant="danger">
          User with this email already exists. Please use a different email.
        </Alert>
      )}
      <Form onSubmit={handleSubmit}>
        <Form.Group controlId="formFirstName">
          <Form.Label>First Name</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter your first name"
            name="first_name"
            value={formData.firstName}
            onChange={handleChange}
            required
          />
        </Form.Group>

        <Form.Group controlId="formLastName">
          <Form.Label>Last Name</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter your last name"
            name="last_name"
            value={formData.lastName}
            onChange={handleChange}
            required
          />
        </Form.Group>

        <Form.Group controlId="formEmail">
          <Form.Label>Email</Form.Label>
          <Form.Control
            type="email"
            placeholder="Enter your email"
            name="email"
            value={formData.email}
            onChange={handleChange}
            required
          />
        </Form.Group>

        <Form.Group controlId="formPassword">
          <Form.Label>Password</Form.Label>
          <Form.Control
            type="password"
            placeholder="Enter your password"
            name="password"
            value={formData.password}
            onChange={handleChange}
            required
          />
        </Form.Group>

        <Form.Group controlId="formConfirmPassword">
          <Form.Label>Confirm Password</Form.Label>
          <Form.Control
            type="password"
            placeholder="Confirm your password"
            name="confirmPassword"
            value={formData.confirmPassword}
            onChange={handleChange}
            required
          />
        </Form.Group>

        <Form.Group controlId="formPhoneNumber">
          <Form.Label>Phone Number</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter your phone number"
            name="phoneNumber"
            value={formData.phoneNumber}
            onChange={handleChange}
            required
          />
        </Form.Group>

        <Form.Group controlId="formCountryCode">
          <Form.Label>Country Code</Form.Label>
          <Form.Control
            as="select"
            name="countryCode"
            value={formData.countryCode}
            onChange={handleChange}
            required
          >
            <option value="">Select Country Code</option>
            <option value="+1">+1 (USA)</option>
            <option value="+44">+44 (UK)</option>
            {/* Add more options as needed */}
          </Form.Control>
        </Form.Group>

        <Button variant="primary" type="submit">
          Register
        </Button>
      </Form>
    </div>
  );
};

export default RegisterPage;
